INSERT INTO `note` VALUES ('1','\r\n \r\n23. dặm\r\n\r\n1	dặm = 500m\r\n10	dặm = 5km\r\n100	dặm = 50km\r\n1.000	dặm = 500km\r\n10.000	dặm = 5.000km\r\n\r\n22. Lists\r\n\r\n6. Thiên Thần Quyết\r\n\r\nMột giọt ma huyết, chiếu phá sơn hà vạn đóa. Một quyển cổ kinh, yên diệt nhật nguyệt luân hồi. Một bộ thần quyết, mai táng chư thiên Chí Tôn. Dương Thanh Huyền được Thiên Mệnh truyền thừa, tu vô địch... ▼\r\n5. Vạn Cổ Chi Vương\r\n\r\nBình dân thiếu niên La Thiên, người mang tuyệt thế chi tư, lại bị ngộ nhận là người phế mạch. Ngẫu nhiên đạt được vô thượng Thiên Thư, mở ra chí cường thần mạch, tu Tạo Hóa Thần Quyết, nhất phi trùng... ▼\r\n4. Tu Thần Ngoại Truyền\r\n\r\nTruyện phải nói là viết rất chi tiết, chi tiết đến mức đọc muốn chửi thằng tác giả, level tăng chậm rì nhưng được cái tình cảm nhẹ nhàng, hài hước, yy chấp nhận được và ít lặp lại mô típ trong các tr... ▼\r\n3. Đại Văn Hào\r\n\r\nTrải qua thương trường trong lục đục với nhau, cụng chén nâng cốc trong ngươi ngu ta trá văn học thanh niên Trần Khải Chi về đến cổ đại.Phóng tầm mắt nhìn lại, nơi này tất cả đều là ca lâu tửu phường... ▼\r\n2. Vĩnh Hằng Chí Tôn\r\n\r\nvũ đỉnh ngọn núi , di sơn đảo hải , bắt tinh cầm tháng , nghịch loạn thời không ! kiếm hết sức cảnh , một kiếm thành đạo , một kiếm thông thần , một kiếm phá vạn pháp ! thiếu niên lý phù trần , thỉnh... ▼\r\n1. Vọng Tộc Phong Lưu\r\n\r\nKhông cẩn thận xuyên qua đến một cái tương tự TQ cổ đại thế giới, nơi đó là tuyệt đối \"tất cả đều hạ phẩm, chỉ có đọc sách cao\", nhưng không có Lý Bạch Đỗ Phủ, Đường Tống Bát đại gia các loại đại văn... ▼\r\n\r\n3. http://truyencv.com/nhat-ngon-thong-thien/\r\n\r\nCùng tác giả ( Trọng Sinh Tiêu Dao Đạo ).********* Cảnh báo: truyện thuần tu tiên, main não to, làm việc suy tính trước sau, xen lẫn chút hài hước, mang chút hơi hướng Nhất Niệm Vĩnh Hằng.!! Có một n... ▼\r\n2. http://truyencv.com/dai-van-hao/\r\n\r\nTrải qua thương trường trong lục đục với nhau, cụng chén nâng cốc trong ngươi ngu ta trá văn học thanh niên Trần Khải Chi về đến cổ đại.Phóng tầm mắt nhìn lại, nơi này tất cả đều là ca lâu tửu phường... ▼\r\n1. http://truyencv.com/nhat-niem-phi-tien/\r\n\r\nThái Cổ niệm tu Đại Năng Giả, Nhất Niệm Thành Ma, Nhất Niệm Thành Phật, cũng có Võ Đạo cao thủ, Phá Toái Hư Không, Duy Ngã Độc Tôn, hiểu trăm sông đổ về một biển, cuối cùng chỉ vì tìm kiếm cái kia mê... ▼\r\n21. Save\r\n\r\nTruyện CV\r\nCuc Pham Gia Dinh\r\nhan mon quat khoi\r\n\r\nTàng thư viện\r\ncau ma\r\ndichnga duc phong thien suu tam\r\ndichphong luu phap su suu tam\r\nhan mon quat khoi\r\nthien dao do thu quan\r\ntu than ngoai truyen\r\ny thong giang son\r\n\r\nWeb truyện\r\nhi du hoa tung\r\nkieu kieu su nuong\r\nnga duc phong thien\r\n\r\nTruyện full\r\nlinh vu thien ha\r\nnga duc phong thien\r\nnhat niem vinh hang\r\n\r\n19. 8632\r\n\r\nhttp://truyencv.cf/ttv/tangthuvien.php?name=dichphong-luu-phap-su-suu-tam&link=https://truyen.tangthuvien.vn/doc-truyen/dichphong-luu-phap-su-suu-tam/chuong-244\r\n\r\n18. đo\r\n\r\n1 dặm = 500m\r\n1 trượng = 3,33m\r\n\r\n17. http://truyencv.cf/ttv/tangthuvien.php?name=dichphong-luu-phap-su-suu-tam&link=https://truyen.tangthuvien.vn/doc-truyen/dichphong-luu-phap-su-suu-tam/chuong-240\r\n\r\n9. http://www.truyencv.cf/ttv/tangthuvien.php?name=y-thong-giang-son&link=https://truyen.tangthuvien.vn/doc-truyen/y-thong-giang-son/1627336-chuong-118\r\n\r\n8. http://truyencv.cf/ttv/tangthuvien.php?name=tu-than-ngoai-truyen&link=https://truyen.tangthuvien.vn/doc-truyen/tu-than-ngoai-truyen/chuong-757\r\n\r\n7. http://www.truyencv.cf/ttv/tangthuvien.php?name=han-mon-quat-khoi&link=https://truyen.tangthuvien.vn/doc-truyen/han-mon-quat-khoi/chuong-613\r\n\r\n6. tu than ngoai truyen 751\r\n\r\nChương 751 mỹ bạch đan dịch\r\n\r\n“Cái kia…… Tiếu ngọt…… Ngọt” trương tiểu hoa cố nén một loại bẹp người xúc động, đem tên này hô ra tới, cũng không phải này nữ đệ tử khó coi, cũng không phải này nữ đệ tử đường cong không tốt, cũng không phải…… Khụ khụ, tóm lại, tên này thật sự là làm trương tiểu hoa kêu lên rất là khó chịu.\r\n\r\n“Ai ~~~~” kia tiếu ngọt ngọt ngọt ngọt lên tiếng, thanh âm kéo lão trường: “Nhậm sư huynh, ngươi thanh âm nghe tới thật là dễ nghe, chúng ta mờ mịt đường nam đệ tử không một người có như vậy tốt tiếng nói, chính là tiểu muội lúc trước nghe qua hát tuồng cũng chưa ngươi nói thật dễ nghe, ngươi…… Thật hẳn là đi diễn kịch.”\r\n\r\n“Ta vựng ~” trương tiểu hoa hơi kém không té ngã, hôm qua trương tiểu hổ đều khuyên chính mình đi diễn kịch, này…… Tiếu ngọt ngào cư nhiên cũng kiến nghị chính mình đi diễn kịch, chẳng lẽ chính mình thực sự có diễn kịch tiềm chất? Liền không có ở tiên đạo phát triển khả năng?\r\n\r\nTrương tiểu hoa nhéo chính mình cằm, “Hì hì” cười nói: “Nhân gia đều giảng quá, diễn kịch là phải có cái hảo túi da, không sợ không có gì diễn kịch kỹ xảo, chỉ cần lộng cái tốt thể diện đặt ở kia sân khấu kịch tử thượng vừa khóc cười, lại làm người ở dưới đài một phủng, mặc cho ai đều là muốn rực rỡ; Tiếu sư muội, ngươi xem ta hành sao?”\r\n\r\n“Gọi người ta tiếu ngọt ngào sao ~” tiếu ngọt ngọt ngọt cười nói: “Nhậm sư huynh nhất có hình, liền thành ngươi cái mũi, đôi mắt của ngươi, ngươi diễn nhân vật người khác đều diễn không thành!”\r\n\r\n“Thật sự?” Trương tiểu hoa đại kỳ, nói: “Đó là cái gì nhân vật?”\r\n\r\n“Chính là…… Chính là cái kia ở cái mũi tô lên màu trắng hình tứ phương cái kia…… Cái gì giác nhi, tới……”\r\n\r\n“Có phải hay không…… Dáng người thấp bé, ở sân khấu kịch thượng nhảy nhót, thoán cao nhảy thấp……?”\r\n\r\nTrương tiểu hoa tức giận hỏi. Kia tiếu ngọt ngào vừa thấy trương vai hề thượng có chút khó coi, lập tức chính là thay đổi khẩu phong, nói; “Nơi nào, nhậm sư huynh dáng người cường tráng, anh tuấn tiêu sái, muốn diễn cũng là……”\r\n\r\n“Thôi bỏ đi.” Trương tiểu hoa mất kiên nhẫn, xua xua tay nói: “Tiếu sư muội, cọ tới cọ lui nói nửa ngày, ta tưởng ngươi có phải hay không cũng nên thiết nhập chính đề? Không biết tìm tại hạ có chuyện gì?”\r\n\r\n“Ai da ~ ngươi xem ngươi, nhậm sư huynh, nếu là không có việc gì tình, sư muội liền không thể cùng sư huynh nói chuyện sao?”\r\n\r\n“Nga, ta lúc ấy quên mất, ta trong viện hỏa thượng, còn ngao canh gừng đâu, chờ ta phát xong hãn, đầu không hôn mê, lại nghe ngươi nói.”\r\n\r\nTrương tiểu hoa làm bộ chính là phải đi.\r\n\r\n“Đừng, nhậm sư huynh, kỳ thật…… Tiểu muội thật là có chuyện tưởng cầu ngươi?”\r\n\r\nTrương tiểu hoa nhìn tiếu ngọt ngào vặn vặn Nini cố làm ra vẻ, cơ hồ vị đều là muốn run rẩy, cường tự chắp tay nói: “Nếu là đan dược đổi dược thảo sự tình, ta lúc trước đã cùng quý đường tuổi trẻ đệ tử nói qua, bực này sự tình không dễ chính thức trực tiếp cùng dương Đường chủ can thiệp, đại gia trong lòng biết rõ ràng liền thành.”\r\n\r\nNhưng nhìn xem tiếu ngọt ngào có chút khó hiểu bộ dáng, chau mày nói: “Nga, Tiếu sư muội nếu không phải vì chuyện này, chẳng lẽ là muốn hỏi tại hạ trước yếu điểm nhi đan dược sao? Nếu là thực sự có bị thương, này…… Bổ huyết đan chờ vật nhưng thật ra có thể trước mượn ngươi một ít, bất quá, ngươi đến kia dược thảo chờ vật tới đổi!”\r\n\r\n“Thật sự?” Kia tiếu ngọt ngào trên mặt vui vẻ nói: “Có phải hay không ngươi đan dược đều có thể kia đồ vật đổi?”\r\n\r\nTrương tiểu hoa sửng sốt, có chút hòa thượng quá cao sờ không tới đầu (không hiểu được tình huống), chính mình có cái gì đan dược, này tiếu ngọt ngào như thế nào sẽ biết? Nhưng vừa rồi đã nói xuất khẩu, đành phải căng da đầu nói: “Đương nhiên, bất quá, cần thiết là giá trị bằng nhau đồ vật mới thành!”\r\n\r\n“Thật tốt quá, ngươi cái loại này có thể mỹ dung đan dịch, muốn bắt cái dạng gì đồ vật mới có thể đổi đâu?”\r\n\r\n“Mỹ dung? Đan dịch??” Trương tiểu hoa buồn bực nói: “Cái gì kêu mỹ dung? Ta cũng không biết những lời này ý tứ, nơi nào tới đan dịch? Tiếu sư muội có phải hay không tìm lầm người?”\r\n\r\n“Ai da, ta liền biết, nhậm sư huynh sẽ cự người với ngàn dặm ở ngoài, cho nên tiểu muội lúc này mới da mặt dày theo như ngươi nói lâu như vậy, có thể tưởng tượng không đến vừa rồi còn gọi nhân gia tiếu ngọt ngào, này chỉ chớp mắt chính là không quen biết nhân gia, gọi người ta Tiếu sư muội.”\r\n\r\nTrương tiểu hoa da đầu tê dại, dùng sức xua tay: “Thật sự, tiếu ngọt ngào, ta thật sự không rõ. Ngươi có thể hay không trước cho ta giải thích một chút, cái gì là mỹ dung?”\r\n\r\n“Sư huynh, ngươi như vậy anh minh thần võ, thông minh tuyệt đỉnh người, như thế nào liền lập tức không rõ, này mỹ dung, tự nhiên chính là mỹ lệ gương mặt ý tứ sao!”\r\n\r\n“Ai da” trương tiểu hoa hơi kém kêu ra tiếng tới, hơn nữa cái kia “Đan dịch”, hắn cơ hồ chính là đoán được cái gì.\r\n\r\nQuả nhiên, liền nghe tiếu ngọt ngào nói: “Nhân gia kính yêu sư huynh a, có phải hay không nhớ tới cái gì tới?”\r\n\r\n“Chẳng lẽ là…… Trần Thần kia nha đầu?” Trương tiểu hoa cơ hồ chính là khẳng định.\r\n\r\n“Chính là, xem sư huynh kêu nhiều thân thiết, còn nha đầu đâu.” Tiếu ngọt ngào thập phần ghen tuông, nói: “Mấy ngày trước đây Trần Thần sư tỷ còn ở tiểu muội trước mặt kêu la trên mặt dài quá ngật đáp, nhưng…… Nhưng ngày hôm qua buổi tối, cư nhiên trên mặt bóng loáng đều có thể cho ruồi bọ té ngã, hơn nữa, nàng mặt vốn không có tiểu muội bạch, lại xem thời điểm, cư nhiên…… Thẳng bức tiểu muội nha, tiểu muội luôn luôn đều là tự xưng là chính mình là ‘ nhất thụ lê hoa áp hải đường ’, đúng là hồng thấu bạch tự hào, nhưng…… Thế nhưng làm trần sư tỷ cấp so không bằng, ngươi nói, này làm giận không làm giận?”\r\n\r\nTrương tiểu hoa há to miệng, cơ hồ chính là muốn đem “Sư muội, ‘ nhất thụ lê hoa áp hải đường ’ những lời này không phải như vậy dùng đi?” Nói ra, có thể tưởng tượng tưởng chính mình phỏng chừng cũng không hảo cùng nàng giải thích, liền sinh sôi nghẹn đi xuống.\r\n\r\nCố nén che miệng khí, muốn giải thích cái gì, liền nghe tiếu ngọt ngào giống như khoái kiếm giống nhau nói: “Vì thế, ta liền tưởng hết biện pháp, cùng trần sư tỷ hỏi trong đó nguyên do, này đều ma một ngày, vừa mới mới từ miệng nàng biết, cư nhiên…… Cư nhiên là nhậm sư huynh cho nàng linh đan diệu dược nha!”\r\n\r\nNgay sau đó, chính là một cái mùa thu cuộn sóng vứt ra, nói: “Chẳng lẽ nhậm sư huynh liền nhìn tiểu muội này bế nguyệt tu hoa trên mặt tiểu ngật đáp liền như vậy hung hăng ngang ngược? Chẳng lẽ nhậm sư huynh liền không nghĩ phụng ra đoàn kết hữu ái chi tâm, chẳng lẽ nhậm sư huynh liền không hiểu đến thương hương tiếc ngọc chi tình……”\r\n\r\nLiên tiếp ba cái “Chẳng lẽ” nói được trương tiểu hoa trong lòng cũng là cực kỳ “Khổ sở”, chính là cười nói: “Này Trần Thần, ta đều cùng nàng giao đãi luôn mãi, đây là tại hạ một bí mật, mỹ…… Cái gì gương mặt đan dịch vốn là không nhiều lắm, ta chính mình còn nghĩ sử dụng đâu, nếu làm người khác đều đã biết, ta chính mình còn dùng không cần?”\r\n\r\n“Thật sự, Tiếu sư muội, ngươi xem ta này mặt, trước kia nếp gấp nhưng nhiều, chính là đôi mắt so hiện tại đều nhỏ rất nhiều, chính là bởi vì vẫn luôn dùng này đan dịch, trên mặt nếp gấp không có, đôi mắt cũng biến đại, ai, duy nhất tiếc nuối chính là này đan dịch không thể đem cái mũi phồng lên, nếu không, tại hạ đã có thể thật sự ngọc thụ lâm phong!”\r\n\r\n“Thật sự???” Tiếu ngọt ngào đôi mắt vô hạn mở rộng, cũng là không quên khích lệ trương tiểu hoa: “Nhậm sư huynh đã anh tuấn phi phàm, cái mũi tái cao thượng một chút nhi, ngươi còn làm chúng ta mờ mịt đường nam đệ tử sống không? Ngươi cảm thấy mỗi ngày nhân gia bởi vì ghen ghét ngươi anh tuấn, chuyên môn vòng quanh ngươi đi, ngươi cảm giác hảo?”\r\n\r\n“Ân, không tốt lắm, vậy có chút anh tuấn tịch mịch, vẫn là thân dân hảo.” Trương tiểu hoa sờ sờ cái mũi, nghiêm trang nói.\r\n\r\n“Cho nên, nhậm sư huynh, ngươi kia mỹ dung đan dịch, vẫn là cho ta phân một chút hảo!”\r\n\r\nAi, nói nửa ngày, rốt cuộc điểm tới rồi chính đề.\r\n\r\n“Này……” Trương tiểu hoa kinh ngạc nói: “Này đan dịch chính là cực trân quý, ngày hôm trước cho Trần Thần ta liền cảm giác không tốt, này vốn là bí mật của ta, hiện tại ngươi truyền ta, ta truyền cho ngươi, chẳng phải là thành thủy tin phong mỗi người đều biết bí mật?”\r\n\r\n“Đúng vậy, nhậm sư huynh, nếu không tiểu muội như thế nào liền ở chỗ này chờ ngươi đâu?”\r\n\r\n“Ở chỗ này chờ ta?” Trương tiểu hoa chỉ vào cái mũi của mình nói: “Đã chờ thật lâu?”\r\n\r\n“Cũng không bao lâu, chỉ là các ngươi thác đan đường tiểu viện môn cũng chưa khai, tiểu muội tưởng ngươi nhất định đi trên núi, lúc này mới nga, sư huynh, ngươi cảm thấy ngươi kia một lọ mỹ dung đan dịch muốn cái gì mới đổi? Tiểu muội đan dược cũng là có một chút nhi!”\r\n\r\n“Cái này……” Trương tiểu hoa có chút do dự, khó xử nói: “Này đan dược, chúng ta thác đan đường trước nay đều là không thiếu, ngươi xem……”\r\n\r\nNói chính là nhìn về phía tiếu ngọt ngào trên đầu, tiếu ngọt ngào sửng sốt, chợt cắn răng một cái, chính là từ đầu thượng tháo xuống cái kia kim trâm, đưa qua, nói: “Tiểu muội cũng không có gì thứ tốt, đây là qua đời mẫu thân lưu lại, cũng có thể đáng giá mấy cái bạc, liền cầm nó cùng sư huynh đổi đi!”\r\n\r\n“Ai da, kia nhiều không tốt?” Trương tiểu hoa nói, đôi mắt lại là dịch bất động.\r\n\r\n“Ha hả” tiếu ngọt ngào có chút cường cười: “Cũng không có gì, chính là cái kỷ niệm mà thôi, có thể đổi cái thanh xuân xinh đẹp mỹ bạch, cũng coi như là đáng giá.”\r\n\r\nNói xong chính là hướng trương tiểu hoa trong tay ngạnh tắc.\r\n\r\nTrương tiểu hoa rất là “Yêu thích” nhéo nhéo, ngay sau đó chính là đưa còn nói: “Như vậy đi, Tiếu sư muội, ta cũng không tùy thân mang theo này đó đan dịch, ngươi thả trở về cái kia bình ngọc, tùy ta đến thác đan đường tiểu viện…… Nga, tính, vẫn là đi các ngươi mờ mịt đường địa bàn đi, ân, chính là các ngươi trương sư huynh trong viện như thế nào? Chúng ta cũng là công bằng giao dịch, cho các ngươi trương sư huynh làm chứng kiến, đừng về sau nói ta ỷ vào là có chính mình có này đan dịch, liền hạt hồ kêu giới!”\r\n\r\n“Nơi nào, nơi nào, nhậm sư huynh nhất công bằng, tiểu muội cũng là cam tâm tình nguyện.” Tiếu ngọt ngào cười nói: “Vậy một lời đã định, tiểu muội này liền đi lấy bình ngọc, đợi chút ở trương sư huynh trong viện chạm trán!”\r\n\r\n“Được rồi.” Trương tiểu hoa cũng là vui mừng.\r\n\r\nVì thế hai người các chạy vội đồ vật.\r\n\r\nTrương tiểu hoa tự nhiên là không cần hồi thác đan đường tiểu viện, biên hướng trương tiểu hổ chỗ ở đi, biên là âm thầm trộm nhạc: “Không thể tưởng được này mờ mịt phái nữ đệ tử cũng là nữ nhân nha, cổ nhân vân hảo: ‘ nữ nhân đồng tiền nhất hảo ’, cố không khinh dư nào! Chỉ cần là cùng thể diện có quan hệ, mặc kệ là cái gì son phấn, vẫn là mỹ bạch đan dịch, đều là làm các nàng điên cuồng, mấy ngày trước đây còn đang đau lòng kia vạn năm thiên chung thạch nhũ, cấp Nhị ca tắm rửa có chút lãng phí, hiện tại liền tìm tới rồi không lãng phí lý do. Này…… Này nhân phẩm không cần thật tốt quá!”\r\n\r\nTrương tiểu hoa nghĩ, chính là đi vào trương tiểu hổ trong viện, chỉ thấy trương tiểu hổ lúc này chính chậm rãi đi ở trong viện, tưởng là ở hoạt động gân cốt, nhìn thấy trương tiểu hoa bộ mặt xuân phong tiến vào, bất giác cười nói: “Di? Như thế nào như vậy cao hứng? Chẳng lẽ là có cái gì hỉ sự?”\r\n\r\n“Hì hì? Đương nhiên là hỉ sự.”\r\n\r\nTrương tiểu hổ nghe xong, cũng là ngừng lại nói: “Mau nói, cái gì hỉ sự này?”\r\n\r\n“Ha ha, ngươi muốn phát tài!”\r\n1. @voice\r\n\r\nhttp://truyencv.cf/html.php?name=ttv-list&link=truyencv.cf/ttv/sites/han-mon-quat-khoi.html\r\n\r\n'),
